【DC SHOE】ディーシーシューのシューズ。<br>DCの新たな定番シューズが登場しました。<br>Switchと同じ技術を採用したアイテム。<br>クラシックタイプのシンプルなデザインを、ニュアンス感ある<br>プレミアム・テキスタイルで仕上げたスニーカー。<br>サイドとタンにはブランドロゴをさりげなくオン。<br>適度な厚みのあるアウトソールを採用し、<br>ふんわりとしたクッション性の高い中敷で、履き心地も抜群。<br>シーズンレスに使い回せるスニーカーとして、<br>カジュアルコーデにマストな1足です。<br><br>■素材■<br>【アッパー】合成繊維+天然皮革<br>【ソール】ゴム底<br><br><img src="https://image.rakuten.co.jp/thesuns/cabinet/bana/information_600-600.gif"><style type="text/css">
