【DC SHOE】ディーシーシューのシューズ。<br>良質なテキスタイルをアッパーに使用したSPARTAN。<br>足元にボリュームをプラスしてくれ、コーディネートの<br>アクセントになります。<br>ステッチや生地の切り替えなどで表現されたディテールも<br>ポイントです。<br>アクティブからタウンシーンまで使え、<br>定番として活躍すること間違いなしの一足です。<br><br>■素材■<br>アッパー：テキスタイルキャンバス<br>ソール：ゴム底<br><br><img src="https://image.rakuten.co.jp/murasaki-sports/cabinet/bana/information_600-600.gif"><br><br>メーカー希望小売価格はメーカー商品タグに基づいて掲載しています<br><img src="https://image.rakuten.co.jp/murasaki-sports/cabinet/17-b/evidence_dm171027.jpg" width="300px"><!--
